const Weather = () => {
  function getForecast() {
    fetch("https://dark-sky.p.rapidapi.com/37.774929,-122.419418,2019-02-20", {
      method: "GET",
      headers: {
        "x-rapidapi-host": "dark-sky.p.rapidapi.com",
        "x-rapidapi-key": "bceb01c09emsh7333c7d8acd9bbfp114330jsn9662e80626cf",
      },
    })
      .then((response) => {
        console.log(response);
      })
      .catch((err) => {
        console.log(err);
      });
  }
  return <div></div>;
};

export default weather;
